@thedeonknox and I are about to celebrate 9 years of marriage in just a few days and I honestly can not believe it🤯 the first picture in the video (in the yellow) is actually the very first picture we ever took together back in September 2009. We had been dating for only a month then and I still remember just how giddy I felt when we took this picture. My stomach was full of butterflies because I just knew it’d be something we’d look back on years later in awe of how far we’d come…yes, after only a month 😂

Looking back, I’m so glad that we allowed God to write our story and ignore all the outside noise. Unfortunately not everyone was rooting us on, but that was always okay because we had each other and that was all we needed. We’ve had fights, blowups, and was even on the brink of separation at one point…BUT GOD🙌🏾 I look back at some of these pictures and don’t even recognize those two individuals because of who we were then…but today in 2022 we’ve been blessed to experience the best versions of each other to date and man, are we soooo in love with who we’ve become TOGETHER ! Growth is a beautiful thing❤️

#marriedlife #blacklove #blacklovedoc#marriage #marriagereels

